import React from 'react';
import './App.css';
import logo from './Images/logo.png';

export default class Header extends React.Component {
  render() {
    return (
      <div className='header'>
        <div className='hed'>
          <img src={logo} />
          <ul>
            <li>HOME</li>
            <li>ABOUT</li>
            <li>SERVICE</li>
            <li>TESTIMONIAL</li>
            <li>CONTACT US</li>
          </ul>
        </div>
        <div className='hed2'></div>
      </div>
    );
  }
}
